import React from "react";
import { StyleSheet, ScrollView, View, Image, Text } from "react-native";
import { Divider } from "react-native-elements";

export default function Login() {
  return (
    <ScrollView>
      <Image
        source={require("../../../assets/img/logo grande.png")}
        resizeMode="contain"
        style={styles.logo}
      />
      <View style={styles.viewContainer}>
        <Text>Login FORM</Text>
        <CreateAccount />
      </View>
      <Divider style={styles.divider} />
    </ScrollView>
  );
}

function CreateAccount(props) {
  return (
    <Text style={styles.textRegister}>
      ¿ Te gustaría crear una cuenta?{" "}
      <Text style={styles.btnRegister} onPress={() => console.log("Registro")}>
        Registrate
      </Text>
    </Text>
  );
}

const styles = StyleSheet.create({
  logo: {
    width: "100%",
    height: 150,
    marginTop: 20,
  },
  viewContainer: {
    marginRight: 40,
    marginLeft: 40,
  },
  textRegister: {
    marginTop: 15,
    marginLeft: 10,
    marginRight: 10,
  },
  btnRegister: {
    color: "#ea4d14fa",
    fontWeight: "bold",
  },
  divider: {
    backgroundColor: "#ea4d14fa",
    margin: 40,
  },
});
